INSERT INTO EMPLEADOS VALUES (1,'Davolio','Nancy','Representante de ventas','Srta.','8/12/1968','1/5/1992','507 - 20th Ave.E.Apt. 2A','Seattle','WA','98122','EE.UU.','(206) 555-9857','5467','EMPID1.BMP','Su formacion incluye una licenciatura en Psicologia por la Universidad del Estado de Colorado. Tambien escribio "El arte de la llamada en frio". Nancy es miembro de toastmasters International.',2);
INSERT INTO EMPLEADOS VALUES (2,'Fuller','Andrew','Vicepresidente comercial','Dr.','19/2/1952','14/8/1992','908 W. Capital Way','Tacoma','WA','98401','EE.UU.','(206) 555-9482','3457','EMPID2.BMP','Andrew completo su licenciatura en Comercio y un doctorado en Marketing Internacional de la Universidad de Dallas. Habla con fluidez en frances e italiano y lee el aleman.Ingreso en la empresa como representante de ventas, fue ascendido a gerente de cuentas y despues fue nombrado vicepresidente comercial.Andrew es miembro de la Mesa redonda de administracion de Ventas, la Camara de comercio de Seattle y de la Asociacion de importadores de la Cuenca del Pacifico.',NULL);
INSERT INTO EMPLEADOS VALUES (3,'Leverling','Janet','Representante de ventas','Srta.','30/8/1963','1/4/1992','722 Moss Bay Blvd.','Kirkland','WA','98033','EE.UU.','(206) 555-3412','3355','EMPID3.BMP','Janet es licenciada en Quimica por la Universidad de Boston. Tambien ha completado un programa de formacion en Gestion de minoristas de alimentacion. Janet fue contratada como vendedora asociada y fue ascendida a representante de ventas.',2);
INSERT INTO EMPLEADOS VALUES (4,'Peacock','Margaret','Representante de ventas','Sra.','19/9/1958','3/5/1993','4110 Old Redmond Rd.','Redmond','WA','98052','EE.UU.','(206) 555-8122','5176','EMPID4.BMP','Margaret es licenciada en Literatura inglesa por el Colegio Universitario Concordia, y tiene un master del Instituto Americano de Artes Culinarias. Estuvo asignada temporalmente a la oficina de Londres antes de regresar a su puesto permanente en Seattle.',2);
INSERT INTO EMPLEADOS VALUES (5,'Buchanan','Steven','Gerente de ventas','Sr.','4/3/1955','17/10/1993','14 Garrett Hill','Londres',NULL,'SW1 8JR','Reino Unido','(71) 555-4848','3453','EMPID5.BMP','Steven Buchanan se graduo en la Universidad de St. Andrews, Escocia. Tras su ingreso en la empresa dedico 6 meses a un programa de orientacion en la oficina de Seattle y luego volvio a su puesto permanente en Londres, donde fue ascendido a gerente de ventas. Completo con exito los cursos de Telemarketing y Gestion de ventas internacional. Habla frances.',2);
INSERT INTO EMPLEADOS VALUES (6,'Suyama','Michael','Representante de ventas','Sr.','2/7/1963','17/10/1993','Coventry House Miner Rd.','Londres',NULL,'EC2 7JR','Reino Unido','(71) 555-7773','428','EMPID6.BMP','Michael se graduo en la Universidad de Sussex (MA, economia) y la Universidad de California en Los Angeles (MBA, marketing). Tambien ha asistido a cursos de Ventas multiculturales y Administracion del tiempo para profesionales de ventas. Habla japones y lee y escribe en frances, portugues y espaniol.',5);
INSERT INTO EMPLEADOS VALUES (7,'King','Robert','Representante de ventas','Sr.','29/5/1960','2/1/1994','Edgeham Hollow Winchester Way','Londres',NULL,'RG1 9SP','Reino Unido','(71) 555-5598','465','EMPID7.BMP','Robert King colaboro en la organizacion Peace Corps y viajo extensamente antes de completar su licenciatura en ingles en la Universidad de Michigan, el anio en que ingreso en la empresa. Despues de completar un curso denominado "Ventas en Europa", fue transferido a la oficina de Londres.',5); 
INSERT INTO EMPLEADOS VALUES (8,'Callahan','Laura','Coordinador ventas interno','Srta.','9/1/1958','5/3/1994','4726 - 11th Ave. N.E.','Seattle','WA','98105','EE.UU.','(206) 555-1189','2344','EMPID8.BMP','Laura se graduo en Psicologia por la Universidad de Washington. Tambien completo un curso de frances de negocios. Lee y escribe en frances.',2);
INSERT INTO EMPLEADOS VALUES (9,'Dodsworth','Anne','Representante de ventas','Srta.','2/7/1969','15/11/1994','7 Houndstooth Rd.','Londres',NULL,'WG2 7LT','Reino Unido','(71) 555-4444','452','EMPID9.BMP','Anne tiene una licenciatura en ingles por el St. Lawrence College.  Habla con fluidez el frances y el aleman.',5);
