DROP TABLE PROVEEDORES CASCADE CONSTRAINT;
DROP TABLE CATEGORIAS CASCADE CONSTRAINT;
DROP TABLE PRODUCTOS CASCADE CONSTRAINT;
DROP TABLE DETALLE_PEDIDOS CASCADE CONSTRAINT;
DROP TABLE PEDIDOS CASCADE CONSTRAINT;
DROP TABLE EMPLEADOS CASCADE CONSTRAINT;
DROP TABLE CLIENTES CASCADE CONSTRAINT;
DROP TABLE COMP_ENVIO CASCADE CONSTRAINT;

CREATE TABLE PROVEEDORES (
	IDPROVEEDOR	NUMBER(3),
	NOMBRE		VARCHAR2(50),
	CONTACTO	VARCHAR2(50),
	CARGO_CONT	VARCHAR2(30),
	DIRECCION	VARCHAR2(50),
	CIUDAD		VARCHAR2(15),
	REGION		VARCHAR2(20),
	CODPOSTAL	VARCHAR2(10),
	PAIS		VARCHAR2(15),
	TELEFONO	VARCHAR2(20),
	FAX		VARCHAR2(15),
	WEB		VARCHAR2(30),
CONSTRAINT PK_PROVEEDORES PRIMARY KEY (IDPROVEEDOR));

CREATE TABLE CATEGORIAS (
	IDCATEGORIA	NUMBER(3),
	NOMBRE		VARCHAR2(15),
	DESCRIPCION	VARCHAR2(80),
CONSTRAINT PK_CATEGORIAS PRIMARY KEY (IDCATEGORIA));

CREATE TABLE PRODUCTOS (
	IDPRODUCTO	NUMBER(3),
	NOMBRE		VARCHAR2(50),
	IDPROVEEDOR	NUMBER(3),
	IDCATEGORIA	NUMBER(3),
	CANTIDADXUNIDAD	VARCHAR2(40),
	PRECIOXUNIDAD	NUMBER(5,2),
	EXISTENCIAS	NUMBER(3),
	UNIDADESPEDIDOS	NUMBER(3),
	NIVELNUEVOPEDIDO NUMBER(3),
	SUSPENDIDO	NUMBER(1),
CONSTRAINT PK_PRODUCTOS PRIMARY KEY (IDPRODUCTO));

CREATE TABLE DETALLE_PEDIDOS (
	IDPEDIDO	NUMBER(5),
	IDPRODUCTO	NUMBER(3),
	PRECIOXUNIDAD	NUMBER(6,2),
	CANTIDAD	NUMBER(3),
	DESCUENTO	NUMBER(4,2),
CONSTRAINT PK_DETALLE_PEDIDOS PRIMARY KEY (IDPEDIDO,IDPRODUCTO));

CREATE TABLE PEDIDOS (
	IDPEDIDO	NUMBER(5),
	IDCLIENTE	VARCHAR2(5),
	IDEMPLEADO	NUMBER(3),
	FECHAPEDIDO	DATE,
	FECHAENTREGA	DATE,
	FECHAENVIO	DATE,
	COMPENVIO	NUMBER(2),
	CARGO		NUMBER(6,2),
	DESTINATARIO	VARCHAR2(50),
	DIRECCIONDEST	VARCHAR2(50),
	CIUDADDEST	VARCHAR2(20),
	REGIONDEST	VARCHAR2(20),
	CODPOSTALDEST	VARCHAR2(10),
	PAISDEST	VARCHAR2(15),
CONSTRAINT PK_PEDIDOS PRIMARY KEY (IDPEDIDO));

CREATE TABLE CLIENTES (
	IDCLIENTE	VARCHAR2(5),
	NOMBRE		VARCHAR2(50),
	CONTACTO	VARCHAR2(50),
	CARGOCONTACTO	VARCHAR2(30),
	DIRECCION	VARCHAR2(50),
	CIUDAD		VARCHAR2(15),
	REGION		VARCHAR2(20),
	CODPOSTAL	VARCHAR2(10),
	PAIS		VARCHAR2(15),
	TELEFONO	VARCHAR2(20),
	FAX		VARCHAR2(17),
CONSTRAINT PK_CLIENTES PRIMARY KEY (IDCLIENTE));

CREATE TABLE COMP_ENVIO (
	IDCOMPANIA	NUMBER(2),
	NOMBRE		VARCHAR2(20),
	TELEFONO	VARCHAR2(15),
CONSTRAINT PK_COMP_ENVIO PRIMARY KEY(IDCOMPANIA));

CREATE TABLE EMPLEADOS (
	IDEMPLEADO	NUMBER(2),
	APELLIDOS	VARCHAR2(20),
	NOMBRE		VARCHAR2(20),
	CARGO		VARCHAR2(30),
	TRATAMIENTO	VARCHAR2(10),
	FNACIMIENTO	DATE,
	FCONTRATACION	DATE,
	DIRECCION	VARCHAR2(50),
	CIUDAD		VARCHAR2(15),
	REGION		VARCHAR2(20),
	CODPOSTAL	VARCHAR2(10),
	PAIS		VARCHAR2(15),
	TELEFONO	VARCHAR2(20),
	EXTENSION	VARCHAR2(5),
	FOTO		VARCHAR2(10),
	NOTAS		VARCHAR2(500),
	JEFE		NUMBER(2),
CONSTRAINT PK_EMPLEADOS PRIMARY KEY(IDEMPLEADO));

