	ADD CONSTRAINT FK_PROD_PROV FOREIGN KEY (IDPROVEEDOR) REFERENCES PROVEEDORES
	ADD CONSTRAINT FK_PROD_CAT FOREIGN KEY (IDCATEGORIA) REFERENCES CATEGORIAS;

ALTER TABLE PEDIDOS
